Create index.js with the following content: import { Plugin, PluginServerApp } from '@signalk/server-api'; module.exports = (app: PluginServerApp): Plugin => { const plugin: Plugin = { id: 'my-signalk-plugin', name: 'My Great Plugin', start: (settings, restartPlugin) => { // start up code goes here. }, stop: () => { // shutdown code goes here. }, schema: () => { properties: { // plugin configuration goes here } } }; return plugin;
} A plugin must return an object containing the following functions: start(settings, restartPlugin): This function is called when the plugin is enabled or when the server starts (and the plugin is enabled). The settings parameter contains the configuration data entered via the Plugin Config screen. restartPlugin is a function that can be called by the plugin to restart itself. stop(): This function is called when the plugin is disabled or after configuration changes. Use this function to "clean up" the resources consumed by the plugin i.e. unsubscribe from streams, stop timers / loops and close devices. schema(): A function that returns an object defining the schema of the plugin's configuration data. It is used by the server to generate the user interface in the Plugin Config screen. Note: When a plugin's configuration is changed the server will first call stop() to stop the plugin and then start() with the new configuration data. A plugin can also contain the following optional functions: uiSchema(): A function that returns an object defining the attributes of the UI components displayed in the Plugin Config screen. registerWithRouter(router): This function (which is called during plugin startup) enables plugins to provide an API by registering paths with the Express router is passed as a parameter when invoked. It is strongly recommended that he plugin implement getOpenAPI() if this function is used. Example: plugin.registerWithRouter = (router) => { router.get('/preferences', (req, res) => { res.status(200).json({ preferences: { color: 'red', speed: 1.23 } }); });
}; getOpenApi(): Function to return the OpenAPI definition. This should be implemented when your plugin provides HTTP endpoints for clients to call. Doing so makes the OpenAPI definition available in the server Admin UI under Documentation -> OpenAPI. Example: const openapi = require('./openApi.json'); plugin.getOpenApi = () => openapi;

