A can subscribe to a stream of updates (deltas) by creating the subscription. Subcriptions are generally manged in the plugin start() and stop() methods to ensure the subscribtions are unsubscribed prior to the plugin stopping to ensure all resources are freed. The following example illustrates the pattern using the subscriptionmanager API method. let unsubscribes = []; plugin.start = (options, restartPlugin) => { app.debug('Plugin started'); let localSubscription = { context: '*', // Get data for all contexts subscribe: [{ path: '*', // Get all paths period: 5000 // Every 5000ms }] }; app.subscriptionmanager.subscribe( localSubscription, unsubscribes, subscriptionError => { app.error('Error:' + subscriptionError); }, delta => { delta.updates.forEach(u => { app.debug(u); }); } );
}; plugin.stop = () => { unsubscribes.forEach(f => f()); unsubscribes = [];
}; In the start() method create a subscription definition localSubscription which is then passed to app.subscriptionmanager.subscribe() as the first argument, we also pass the unsubscribes array in the second argument. The third argument is a function that will be called when there's an error. The final argument is a function that will be called every time an update is received. In the stop() method each subcription in the unsubscribes array is unsubscribed and the resources released.

