A resource provider plugin is a Signal K server plugin that implements the Resource Provider Interface which: Tells server the resource type(s) provided for by the plugin (i.e. route, waypoint, etc.) Registers the methods used to action requests passed from the server and perform the writing, retrieval and deletion of resources from storage. Note: multiple providers can be registered for a resource type (e.g. 2 x chart providers) The ResourceProvider interface is defined as follows in @signalk/server-api : interface ResourceProvider { type: ResourceType methods: ResourceProviderMethods
} where: type: The resource type provided for by the plugin. These can be either Standard (Signal K defined) or Custom (user defined) resource types (e.g. 'routes', 'fishingZones') methods: An object implementing the ResourceProviderMethods interface defining the functions to which resource requests are passed by the SignalK server. Note: The plugin MUST implement each method, even if that operation is NOT supported by the plugin! The ResourceProviderMethods interface is defined as follows in @signalk/server-api : interface ResourceProviderMethods { listResources: (query: { [key: string]: any }) => Promise<{[id: string]: any}> getResource: (id: string, property?: string) => Promise<object> setResource: ( id: string, value: { [key: string]: any } ) => Promise<void> deleteResource: (id: string) => Promise<void>
} Note: The Resource Provider is responsible for implementing the methods and returning data in the required format!

